@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:Customer a owl:Class .
atm:Card a owl:Class .
atm:ATM a owl:Class .
atm:Money a owl:Class .
atm:dispense a owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Money .

atm:hasTaken a owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:Card .

atm:AfterTakingCard a owl:Class ;
    rdfs:subClassOf atm:Customer ;
    owl:equivalentClass [ a owl:Restriction ;
                          owl:onProperty atm:hasTaken ;
                          owl:someValuesFrom atm:Card ] .

atm:DispenseMoney a owl:Class ;
    rdfs:subClassOf atm:ATM ;
    owl:equivalentClass [ a owl:Restriction ;
                          owl:onProperty atm:dispense ;
                          owl:someValuesFrom atm:Money ] .

atm:AfterTakingCardThenDispenseMoney a owl:Class ;
    owl:intersectionOf ( atm:AfterTakingCard atm:DispenseMoney ) .
